// src/components/ProjectItem.js
import React from 'react';
import './ProjectItem.css';

const ProjectItem = ({ project }) => {
    return (
        <div className="project-item">
            <h3 className="project-item__title">{project.title}</h3>
            <p className="project-item__description">{project.description}</p>
            <p className="project-item__technologies">
                <strong>Technologies:</strong> {project.technologies.join(', ')}
            </p>
            <a href={project.link} target="_blank" rel="noopener noreferrer" className="project-item__link">
                View Project
            </a>
        </div>
    );
};

export default ProjectItem;
